import { Routes, Route, BrowserRouter } from 'react-router-dom';
import LoginSignupPage from '../Pages/LoginSignUpPage/LoginSignupPage.jsx';
import ItemForm from '../Components/ItemCreate/ItemCreate.jsx';
import ItemList from '../Pages/ItemList/ItemList.jsx'
import ItemViewPage from '../Components/ItemViewPage/ItemViewPage.jsx';
import NavBar from '../Components/NavBar/NavBar.jsx';
import './App.css';

function App() {
  return (
    <>
    <div className="App">
      <header>
      <NavBar />
        <h1>Sustainable Swap Shop</h1>
      </header>

    <div>
      <BrowserRouter>
      <Routes>
        <Route path='/login' element={<LoginSignupPage />} />
        <Route path='/items/:itemId' element={<ItemViewPage />} />
        <Route path='/item/create' element={<ItemForm />} />
        <Route path='/' element={<ItemList />} /> 

      </Routes>
      </BrowserRouter>
    </div>
    </div>
    </>

  );
}

export default App;
